function updateVBGRIDNO() {
//new GC
//incase last call crashed
tot1VBGRIDNO=0;
ScriptsNeededVBGRIDNO = new Array();
ELEVarrayVBGRIDNO  = new Array(); //added for multipart

VBVAR_COMPLEX

//NEW GC 
//for each XY in array cycle through them and put the required script file in a list 
ELEVarrayVBGRIDNO  = new Array();
//use chainages from first grid
for  (h=0; h<ELEVarray.length; h++){
ELEVarrayVBGRIDNO[h] = new Array(1);
ELEVarrayVBGRIDNO[h][0] = ELEVarray[h][0];
}

for (h=0; h<ELEVarrayVBGRIDNO.length; h++){
	if (parseInt(Yarray[h]) < num_of_rowsVBGRIDNO && parseInt(Yarray[h]) > 0) {
	//get grid square and load JS		
		var gridX = Math.floor(Xarray[h]/gridsizeVBGRIDNO)+1;
		var gridY = Math.floor(Yarray[h]/gridsizeVBGRIDNO);
		var gridref ="gVBGRIDNOr" + ((Math.floor((num_of_rows-Yarray[h])/gridsizeVBGRIDNO)) + 1) + "c" + gridX + ".js";		

		//check if valid grid and line number, only add to array if it is.  //new validation
		var checknum = 0;
		if (gridX > xgridsVBGRIDNO  || gridX < 1){checknum = 1}
		if (gridY > ygridsVBGRIDNO  || gridY < 0){checknum = 1}
		if ((num_of_rowsVBGRIDNO - parseInt(Yarray[h])) > num_of_linesVBGRIDNO  || (num_of_rowsVBGRIDNO - parseInt(Yarray[h])) < 1){checknum = 1}
		//end checks
		if(checknum == 0){

		//checks and current list creation
		//check if script is in master list (ignore if it is
		if (CheckMasterVBGRIDNO(gridref) == false) {
			//check if script is in current list (to aviod duplication
			if (CheckCurrentVBGRIDNO(gridref) == false) {
				//this is the first occurance of ths script - add to current list
				ScriptsNeededVBGRIDNO[ScriptsNeededVBGRIDNO.length] = gridref;				
			}			
		}
		}				
}
}

		//set the amount of scripts to be loaded - this will be matched to how many have loaded.
		CurrentLoadTotalVBGRIDNO = ScriptsNeededVBGRIDNO.length;

		//set global arrays to match those just created
		currentXarrayVBGRIDNO = Xarray;
		currentYarrayVBGRIDNO = Yarray;

		//if scripts are needed get them else skip
		//fire off script loads
		if (ScriptsNeededVBGRIDNO.length > 0) {
		for (n=0;n<ScriptsNeededVBGRIDNO.length;n++){ //may not be any
		 //removed onload events as not working correctly over http (fine over file protocol)... have added line to end of script files tohave same effect.
			var headID = document.getElementsByTagName("head")[0];         
			var newScript = document.createElement('script');
			newScript.type = 'text/javascript';
			newScript.src = 'VBVAR_PATH'  + ScriptsNeededVBGRIDNO[n];
			//pesky 'know it all' browsers' (i'm bitter because i've had to re-write this tool as GChrome seems to have one place where it is less standards complient than IE !!)
//			newScript.onload=function(){CurrentLoadTotalVBGRIDNO = CurrentLoadTotalVBGRIDNO - 1; allLoadedVBGRIDNO()};
			//IE
//			newScript.onreadystatechange = function() {if (this.readyState == 'complete') {CurrentLoadTotalVBGRIDNO = CurrentLoadTotalVBGRIDNO - 1; allLoadedVBGRIDNO();}}
			headID.appendChild(newScript);
		}
		}else{
		//if no scripts need loading
		    if (ScriptsNeededVBGRIDNO.length == 0){CurrentLoadTotalVBGRIDNO = 0; allLoadedVBGRIDNO();}
		}

}

//NEW GC 
//function to determine if a script is in master list
function CheckMasterVBGRIDNO(GRef){
var isloaded = false;
	for (t=0;t<MasterScriptListVBGRIDNO.length;t++){
		if (MasterScriptListVBGRIDNO[t] == GRef){isloaded = true;}
	}
	return isloaded;
}

//NEW GC 
//function to determine if a script is in current
function CheckCurrentVBGRIDNO(GRef){
var isloaded = false;
	for (t=0;t<ScriptsNeededVBGRIDNO.length;t++){
		if (ScriptsNeededVBGRIDNO[t] == GRef){isloaded = true;}
	}
	return isloaded;
}

//NEW GC 
//function to determine if all scripts in current list are loaded
function allLoadedVBGRIDNO(){
var isloaded = false;
		if (CurrentLoadTotalVBGRIDNO == 0){
			isloaded = true; 
			SendLevelRequestsVBGRIDNO()
			//add current script list to master script list
				for (t=0;t<ScriptsNeededVBGRIDNO.length;t++){
					MasterScriptListVBGRIDNO[MasterScriptListVBGRIDNO.length] = ScriptsNeededVBGRIDNO[t];
				}

			//clear current list
			ScriptsNeededVBGRIDNO = new Array();
		}
}

//NEW GC 
//function to send off grid value retrievals
function SendLevelRequestsVBGRIDNO(){
	for (t=0;t<ELEVarrayVBGRIDNO.length;t++){
		var gridX = Math.floor(currentXarrayVBGRIDNO[t]/gridsizeVBGRIDNO)+1;
		var gridY = Math.floor(currentYarrayVBGRIDNO[t]/gridsizeVBGRIDNO);
		scriptLoadedVBGRIDNO(t,interval,t,currentXarrayVBGRIDNO[t],currentYarrayVBGRIDNO[t],gridX,gridY,num_of_rowsVBGRIDNO,gridsizeVBGRIDNO);
	}
}





//do after all scripts loaded
function scriptLoadedVBGRIDNO(h,interval,count,Xarrayh,Yarrayh,gridX,gridY,num_of_rows,gridsize) {
	//ELEVarrayVBGRIDNO[h] = new Array(1);
	//ELEVarrayVBGRIDNO[h][0] = interval * count;

	//check if valid grid and line number, only add to array if it is.  //new validation
	var checknum = 0;
	if (gridX > xgridsVBGRIDNO || gridX < 1 ){checknum = 1}
	if (gridY > ygridsVBGRIDNO || gridY < 0){checknum = 1}
	if ((num_of_rowsVBGRIDNO - parseInt(Yarrayh)) > num_of_linesVBGRIDNO || (num_of_rowsVBGRIDNO - parseInt(Yarrayh)) < 1){checknum = 1}

	if (checknum == 0){
	ELEVarrayVBGRIDNO[h][1] = eval("gVBGRIDNOr" + ((Math.floor((num_of_rows-Yarrayh)/gridsize)) + 1) + "c" + gridX + "l" + (num_of_rows - parseInt(Yarrayh)) + "[" + (((parseInt(Xarrayh))) - (gridsize * (gridX - 1))) + "]");
	} else
	{ELEVarrayVBGRIDNO[h][1] = 0}	
	tot1 = tot1 + 1;


if(tot1 == (((ELEVarrayVBGRIDNO.length) * num_of_grids)) ){//do only when all elevations have been retrieved
	//show correct tab to stop flot giving no heigh/width error
	switch_tabs($('.defaulttab'));

	//update xsec chart	
	$.plot("#graph",VB[ELEVarray], options);	

	//build html table from ELEVarray
	var htmlTAB;
	fullArray =  new Array();
	fullArray[0] =  new Array();
	htmlTAB = "<table><tr><th>Sample</th><th>Distance</th>VBVAR_TABLEHEAD</tr>";
	for (i=0; i<ELEVarray.length; i++){
	htmlTAB = htmlTAB + "<tr><td>" + i + "</td><td>" + ELEVarray[i][0].toFixed(2) + "</td><td>" + ELEVarray[i][1] + "</td>VBVAR_TABLEBUILDER</tr>";
	VBVAR_FULLARRAY
	}
	htmlTAB = htmlTAB + "</table>";
	document.getElementById('table').innerHTML = htmlTAB;

	tot1=0;

	}
}


